<?php

namespace pocketmine\network\protocol\v310;

use pocketmine\network\protocol\Info331;
use pocketmine\network\protocol\PEPacket;

class AvailableEntityIdentifiersPacket extends PEPacket {

	const NETWORK_ID = Info331::AVAILABLE_ENTITY_IDENTIFIERS_PACKET;
	const PACKET_NAME = "AVAILABLE_ENTITY_IDENTIFIERS_PACKET";
	//TODO: needs to be modified. Compound tags no longer contain experimental flag
	const HARDCODED_NBT_BLOB = "";

	public $namedtag;

	public function decode($playerProtocol) {
		$this->getHeader($playerProtocol);
		$this->namedtag = $this->get(true);
	}

	public function encode($playerProtocol) {
		$this->reset($playerProtocol);
		$this->put(empty($this->namedtag) ? base64_decode(self::HARDCODED_NBT_BLOB) : $this->namedtag);
	}

}
